INSERT INTO `t3_tbl_board` (`BOARD_NO`, `USER_NO`, `TITLE`, `CONTENT`, `NICK`, `VIEW`, `CDATETIME`, `UDATETIME`) VALUES
	(137, 10000053, '망치입니다.', '<p>귀업조?</p>', '지나', 90, '2023-08-24 14:41:28', '2023-08-24 18:24:27'),
	(141, 10000074, '박지나 커뮤니티 찢.었.다.', '<pre class="ql-syntax" spellcheck="false">ㅈ지나야 찢었다찢었어\n</pre>', '빵대', 10, '2023-08-24 15:31:23', '2023-08-24 15:31:23'),
	(143, 10000074, '이진아의 영혼이 갈린 커뮤니티 멋지다', '<h1 class="ql-indent-2"><strong class="ql-font-monospace"><u>이진아의 영혼이 갈린 커뮤니티 멋지다</u></strong></h1>', '빵대', 3, '2023-08-24 15:32:52', '2023-08-24 15:32:52'),
	(155, 10000085, '20년 된 9평 공간을 생기 넘치게! 디자이너의 러그 활용법', '<p><img src="data:image/jpeg;base64,"></p><p><img src="data:image/jpeg;base64,"></p><p><br></p><p><br></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(47, 52, 56);">좁은 공간을 효율적으로 활용하는 방법에 대해서 고민이 많았어요. 파티션을 둘까도 고민해 봤지만, 이 공간이 가진 </span><strong style="background-color: rgb(255, 255, 255); color: rgb(47, 52, 56);">\'개방감\'</strong><span style="background-color: rgb(255, 255, 255); color: rgb(47, 52, 56);">이라는 장점을 훼손시키고 싶진 않더라고요.</span></p><p><br></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(47, 52, 56);">그러다 러그로&nbsp;어두운 바닥색을 커버하면서&nbsp;공간을 분리하는 방법을 택하게 되었습니다.&nbsp;제 공간을 러그로 나눠보자면&nbsp;네이비 러그는&nbsp;작업 공간,&nbsp;다이아 러그는 침대,&nbsp;스트라이프는 화장실,&nbsp;테라조는 주방으로 공간이 나뉜답니다 :-)&nbsp;</span></p><p><br></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(47, 52, 56);"><span class="ql-cursor">﻿</span></span></p>', '최헬로', 1, '2023-08-24 18:03:32', '2023-08-24 18:03:32'),
	(157, 10000068, '취업 후 첫 월급, 작고 소중한 3평방에 투자했어요🖤', '<p><img src="data:image/jpeg;base64,"><img src="data:image/jpeg;base64,"><img src="data:image/jpeg;base64,"></p><p><br></p><p><br></p><p>제 취향이 가득 담긴 오로지 저만의 공간을 소개합니다!</p><p>저는 메인 색을 화이트 / 블랙으로 골랐답니다. 대부분 아네시에서 구매한 것들인데 예쁜 게 많아서 고르는 데에는 시간이 얼마 걸리지 않았어요. 좀 괜찮다 싶은 게 있더라도 톡톡 튀는 색감의 소품은 과감히 패스했습니다.</p><p><br></p><p><br></p><p><br></p>', '방대방', 8, '2023-08-24 18:09:30', '2023-08-24 18:09:30'),
	(158, 10000073, '인테리어 업계 6년 차, 취향으로 물든 빈티지 하우스', '<p><img src="data:image/jpeg;base64,"></p><p><br></p><p><br></p><p><br></p><p><span style="color: rgb(41, 41, 41);">처음 독립하면서 구매한 확장형 테이블을 중심에 배치하고, 그 옆에는 오랫동안 정말 가지고 싶어 하던 지류함을 드디어! 큰맘 먹고 주문 제작했습니다. 유리 상판 옵션을 추가해서 저만의 취향 전시대 같은 느낌을 주었어요. 제게 유의미 물건들로 천천히 그 자리를 채워나갈 계획이에요.</span></p><p><br></p><p><br></p><p><br></p><p><img src="data:image/jpeg;base64,"></p><p><br></p><p><br></p><p><span style="color: rgb(41, 41, 41);">&nbsp;</span></p><p><span style="color: rgb(41, 41, 41);">턴테이블도 드디어 제 자리를 찾아서 제 일상 BGM을 책임지고 있답니다. 아빠가 40년 전에 모으시던 LP들을 물려받아 그 시절 아빠의 취향을 느껴보기도 하고, 회현 지하상가에서 사 온 재즈 LP를 듣기도 해요.&nbsp;</span></p><p><br></p><p><br></p><p><br></p>', '최해지', 58, '2023-08-24 18:12:34', '2023-08-28 16:53:36'),
	(160, 10000071, '아들 둘 있는 집 맞나요? 정갈하게 꾸민 34평', '<p><img src="data:image/jpeg;base64,"></p><p><img src="data:image/jpeg;base64,"></p>', '최찬신', 10, '2023-08-24 18:18:08', '2023-08-24 18:18:08');
INSERT INTO `t3_tbl_board` (`BOARD_NO`, `USER_NO`, `TITLE`, `CONTENT`, `NICK`, `VIEW`, `CDATETIME`, `UDATETIME`) VALUES
	(161, 10000080, '장거리 출퇴근 안녕👋 삶의 질이 올라가는 4평 자취라이프', '<p><img src="data:image/jpeg;base64,"></p><p><img src="data:image/jpeg;base64,"></p><p><br></p><p><br></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(47, 52, 56);">아직 완벽하게 꾸미지 못해서 좀 부끄럽지만 현재 방 모습이에요. 본가에서는 브라운 톤의 원목가구로 스타일링을 해서 지냈었고, 자취를 시작하게 되면 스틸 가구를 활용해서 모던하게 꾸며보고 싶었어요.</span></p><p><br></p><p><br></p>', '최와우', 19, '2023-08-24 18:22:50', '2023-08-24 18:22:50'),
	(162, 10000081, '화이트 베이스, 짙은 원목의 텍스처를 더한 감성 인테리어', '<p><img src="data:image/jpeg;base64,"></p><p><img src="data:image/jpeg;base64,"></p><p><br></p><p><br></p><p>평범한 거실은 노놉 ❌ 라운지 느낌 거실을 만들어 보고 싶었어요. 거실을 반으로 나눠 소파 중심 인테리어, 반대편은 홈카페 인테리어로 매치해봤어요! 거실이 조금 좁아보이지만 색다른 홈스타일링이여서 재미있었어요!</p><p>라운지 느낌의 거실은 가족들이 옹기종기 모여 대화하기 좋은 가구배치인 것 같아요. 거실에서 티비만 보는 형태가 아닌^^ 대화도 하고, 커피도 마시면서 더 다양한 일을 할 수 있는 공간으로 탄생했어요&nbsp;</p><p><br></p><p><br></p><p><br></p>', '박유저', 29, '2023-08-24 18:27:35', '2023-08-24 18:27:35'),
	(163, 10000086, '휴식에 진심인 집순이의 6평 방, 빈티지 호텔처럼 꾸미기!', '<p><img src="data:image/jpeg;base64,"></p><p><br></p><p><img src="data:image/jpeg;base64,"></p><p><br></p><p><br></p><p><br></p><p>이 곳은 제가 제일 공들인 공간이에요. 옛날 호텔 분위기를 내고 싶어서 벽난로를 중심으로 가구를 배치해 봤습니다. 의자와 테이블 고를 때도 정말 많은 고민을 했는데요, 가구를 고를 때 가장 중요시했던 부분은 어떤 가구를 써야 고전적인 호텔 느낌을 낼 수 있을까 였습니다.</p><p>그래서 의자는 되도록 고급스러우면서 빈티지한 가구로 고르고 싶었는데요. 등받이가 부드러운 곡선들로 이루어져 있어서 고급스러운 느낌이 나면서 의자 다리가 골드여서 빈티지하면서 고급스러운 느낌이 나 좋은 선택이었다고 생각해요.</p><p>테이블은 요즘 유행하는 흰색 원반 테이블이에요! 사이즈가 딱 알맞아서 구매를 하긴 했는데 고전적인 느낌이 나는 가구는 아니었어요 오히려 모던한 쪽에 더 가까웠죠. 그래서 빈티지한 테이블 보를 깔아줬어요! 이렇게 하니 잘 어우러지죠?&nbsp;</p><p>러그 색은 따뜻한 베이지 색으로 의자와 깔맞춤을 해보았는데요. 그래서 조금 더 따뜻한 방 분위기를 연출할 수 있었습니다.&nbsp;제 방엔 꽃이 정말 많은데요. 테이블 위에 하나 액자 밑에 하나 그리고 벽난로 앞에 두 개 총 4개가 있어요. 각자 다른 모양의 꽃병을 두어 차별점을 두도록 했습니다.</p><p><br></p><p><br></p>', '남궁바이', 10, '2023-08-24 18:30:21', '2023-08-24 18:30:21'),
	(164, 10000072, '가족에게 맞춰서 더 아늑하고 편안하게 돌아온 두 번째 집들이', '<p><img src="data:image/jpeg;base64,"></p><p><img src="data:image/jpeg;base64,"></p><p><br></p><p><br></p><p>저희 집은 올해로 준공된 지 17년차가 되는 타워형 아파트에요. 공사기간이 여유롭지 않아서 싱크대 교체, 폴딩도어, 마루, 도배, 조명교체 부분 공사를 하며 들어왔어요.&nbsp;전체적으로 무드는 하얀 도화지다 생각을 하며 집의 바탕을 만들었어요.&nbsp;그리고 \'가구와 패브릭, 인테리어 소품들로 집을 그려야지~\'하는 마음으로 꾸미고 있는 집입니다.</p><p>부분 공사라 살면서 아쉬운 부분이 늘어나는 건 있지만 폴딩 도어 시공을 한 거실은 200% 만족하며 살고 있어요. 겨울에는 따뜻하게, 여름에는 넓은 공간을 만들어주거든요. 하지만 전기 공사를 안한 부분은 아직도 아쉬워요. 다음 집은 꼭! 전체 리모델링 공사를 하고 들어갈 거에요.</p><p><br></p><p><br></p>', '최재승', 16, '2023-08-24 18:32:47', '2023-08-24 18:32:47');
INSERT INTO `t3_tbl_board` (`BOARD_NO`, `USER_NO`, `TITLE`, `CONTENT`, `NICK`, `VIEW`, `CDATETIME`, `UDATETIME`) VALUES
	(165, 10000094, '취향 수집 기록가의 첫 자취집, 온전한 나다움으로 채우다.', '<p><img src="data:image/jpeg;base64,"></p><p><img src="data:image/jpeg;base64,"></p><p><br></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(47, 52, 56);">이사하면서 가장 신경쓴 공간은 바로 거실이에요. 그동안 수집해온 빈티지 가구들과, 이사 오면서 구매한 새 가구들이 조화를 이룬 곳이죠. 전형적인 \'거실\'의 모습이 아닌, 저의 생활 습관에 맞추어 온전히 쉴 수 있는 공간을 만들고자 했어요.</span></p><p><br></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(47, 52, 56);"><span class="ql-cursor">﻿</span></span></p>', '얠임', 11, '2023-08-24 18:40:58', '2023-08-24 18:40:58'),
	(184, 10000068, '간결하고 단정한 수납이 돋보이는 34평 신축 아파트', '<p><img src="data:image/jpeg;base64,"></p><p><br></p><p><br></p><p>입주 후, 소파를 벽 쪽으로 붙이지 않고&nbsp;앞으로 배치 후 뒷 공간에는 모듈형 가구와 원테이블, 수납장을 배치했어요. 모듈형 가구는 온 가족이 pc 를 할 수 있는 데스크 공간으로 만들고, 그 앞으로 모듈형 소파를 놓았지요.</p><p>소파를 벽 쪽에 붙였으면 TV까지의 거리가 넓어져 집이 넓어 보이는 효과는 있었겠지만 pc 공간과 수납공간으로 만들어 거실의 활용도는 배가 되었어요.&nbsp;&nbsp;</p><p><br></p><p><br></p><p><br></p><p><img src="data:image/jpeg;base64,"></p><p><br></p><p><br></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(47, 52, 56);">소파는 한두 달에 한 번쯤 모듈을 이리저리 바꾸어 거실의 분위기를 바꿔주어요. 거실에는 보통 중심을 잡아주는 덩치 큰 가구들이 주를 이루다 보니 배치에 변화를 주기가 어려운데 모듈형 소파는 손쉽게 배치를 바꿀 수 있게 제작되어 좋아요.</span></p><p><br></p><p><br></p><p><img src="data:image/jpeg;base64,"></p><p><br></p><p><br></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(47, 52, 56);">한 개의 소파를 둘로 나누어 원 테이블을 코너에 두기도 하는데요, 이 배치는 원 테이블에 의자 몇 개만 더 두면 온 가족이 둘러앉아 이야기를 나눌 수 있는 공간이 되기도 하고, 코너가 주는 안정감과 아늑함이 있어 좋아하는 배치예요:)&nbsp;</span></p><p><br></p><p><br></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(47, 52, 56);"><span class="ql-cursor">﻿</span></span></p>', '방대방', 10, '2023-08-28 16:51:13', '2023-08-28 16:51:13'),
	(185, 10000101, '9평 1.5룸, 1인 가구의 슬기로운 자취 생활 😎', '<p><img src="data:image/jpeg;base64,"></p><p><br></p><p><br></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(41, 41, 41);">저의 첫 번째 집은 8평대 원룸 오피스텔이었어요. 20대 후반까지 가족과 함께 살았던 저에게 자취는 꿈만 같은 일이라 무척 설렜던 기억이 납니다. 첫 자취인 만큼 집들이도 자주 했고, 평소 로망이었던 인테리어로 방을 꾸미기 위해 소품도 이것저것 많이 샀고요.</span></p><p><br></p><p><br></p><p><img src="data:image/jpeg;base64,"></p><p><br></p><p><br></p><p><br></p><p>이 집은 그 무렵의 저를 닮아있던 집이에요. 5평도 안되는 작은 원룸이었지만 그 안에서 얼마나 많은 일들을 꾸몄는지, 이 쪽 끝에서 저 쪽 끝까지 세 걸음이면 끝나는 그 작은 방에서 얼마나 종종거리며 돌아다녔는지.</p><p>지금도 가끔 이 때가 생각이 나요. 영화 콜미바이유어네임을 보고 영감을 받아 방 안을 이탈리아스럽게(?) 꾸며 놓기도 하고, 크리스마스에는 (우리집에 놀러온 엄마의 표현을 빌자면) 제 방보다 큰 트리를 장식해 두고 홈파티도 하고요.</p><p><br></p><p><br></p><p><br></p><p><br></p><p><img src="data:image/jpeg;base64,"></p><p><br></p><p><br></p><p>분명히 힘들기도 한 때였는데, 고개를 돌리면 한 창 가득 보이던 나의 오랜 친구 같던 동네가 저를 지탱해주던 시절이에요. 이 때, 집을 고를 때 창 밖에 무엇이 보이는가가 얼마나 중요한 지를 알았어요.</p><p><br></p><p><br></p><p><br></p><p><img src="data:image/jpeg;base64,"></p><p><br></p><p><br></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(47, 52, 56);">앞으로도 저는 계절과 날씨를 느낄 수 있는 집을 가꾸며 슬기로운 자취 생활을 이어가려고 해요. 여러분의 집 생활도 무탈하고 편안하기를, 굳이 시간을 내어 만들어낸 행복한 순간들로 가득하길 바라요!</span></p><p><br></p><p><br></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(47, 52, 56);"><span class="ql-cursor">﻿﻿﻿</span></span></p>', '민장', 15, '2023-08-29 10:50:42', '2023-08-29 10:52:51'),
	(186, 10000074, '글쓰기', '<p>ㄱ글쓰기</p>', '빵대', 0, '2023-08-29 16:09:29', '2023-08-29 16:09:29');
