	(30, 10000056, '박중고', '01045151141', '명품의자.Steelcase(스틸케이스) Think(씽크)체어', 400000, 240000, '이태리', 0, 'A', '<p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">스틸케이스 씽크 의자 입니다</span></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">제품상태  매우 좋습니다.</span></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">2019년도 제품으로   실사용은  1년 가량입니다</span></p>', 'Y', '<p>size: 150* 60cm</p>', 'N', '2023-08-24 17:01:03', '2023-08-28 17:59:26', 'Y', 260000),
	(32, 10000002, '오자바', '01055552222', '봄소와 이태리천연소가죽 3인용 쇼파+스툴', 4000000, 1520000, '이태리', 0, 'A', '<p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">봄소와 ‘나루’ 3인용 쇼파 스툴 세트 팝니다.</span></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">(2100 x 830 x 870 / 스툴 850 x 700 x 420) </span></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">이태리 천연 소가죽, 진저 색상 모델 입니다.</span></p><p><br></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">작년 7월, 현대백화점 신도림점에서 구매했고, </span></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">사용감 거의 없는 새 쇼파예요. 제일 아끼는 가구였는데 이사가며 평수가 바뀌게 되어 팝니다. </span></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">남편과 제가 출퇴근후에 잠깐 앉은 게 다라</span></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">정말 새것처럼 깨끗합니다. </span></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">디자인도 세련되어서 어디든 잘 어울려요. </span></p><p><br></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">제품 설명은 봄소와 마루로 검색하시면 됩니다.</span></p>', 'Y', '<p>size : 230 * 130 cm</p>', 'N', '2023-08-24 17:07:55', '2023-08-28 16:27:14', 'Y', 1800000),
	(33, 10000053, '김몰랑', '01078241514', '82년도 빈티지 미드센추리 사우디 전화기 인테리어 소품', 200000, 70000, '중국', 6, 'B', '<p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">82년도에 생산된 빈티지 전화기입니다</span></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">색감과 디자인이 아주 예뻐요</span></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">전원 선이 없어서 실사용 하시려면 전원 선 수리하셔야 합니다 얼마 안 해요</span></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">희소성만 놓고 보아도 훌륭한 매물입니다</span></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">메니아 분들에게 좋은 기회라 생각합니다</span></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">인테리어 연출 소품용으로 판매합니다</span></p>', 'Y', '<p>size : 20 * 28 cm</p><p>전화선 연결 안 됩니다. 수리 후 사용 가능할 것으로 보입니다.</p><p>빈티지 소품으로 사용 가능하며 사용감 있지만 상태 양호한 편입니다.</p>', 'N', '2023-08-24 17:25:53', '2023-08-24 17:25:53', 'Y', 99000),
	(34, 10000004, '박박히선', '01088889999', '금속 칠보 함', 50000, 8000, '중국', 6, 'C', '<p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">금속 칠보 함</span></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">가로 3.5</span></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">높이 5.5</span></p>', 'Y', '<p>size:  15 * 20 cm</p>', 'N', '2023-08-24 17:29:06', '2023-08-24 17:29:06', 'Y', 12000),
	(35, 10000091, '유햄찌', '01074518854', '방가방가 햄토리 네잎클로버 얼굴 쿠션', 50000, 20000, '일본', 0, 'A', '<p>사용 안 해서 새것입니다.</p>', 'Y', '<p>size: 30*25cm</p>', 'N', '2023-08-24 17:31:52', '2023-08-28 17:58:27', 'Y', 30000),
	(36, 10000068, '피카소', '01068858953', '얼굴모양 세라믹화병', 30000, 8000, '중국', 0, 'A', '<p>화병입니다</p>', 'Y', '<p>size : 20 * 13 cm</p>', 'N', '2023-08-24 17:34:31', '2023-08-24 17:34:31', 'Y', 12000),
	(37, 10000053, '이캐아', '01024242323', '네덜란드 빈티지 이케아 램프', 98000, 50000, '네덜란드', 5, 'B', '<p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">빈티지 네덜란드 브라운+그린 체크 플리츠 램프갓+ 이케아 빈티지 램프입니다.</span></p><p><br></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">쉐이드에 약간 보풀 있는 빈티지이고 베이스도 가까이에서 보이는 가는 스크래치 있지만 전체적으러 깔끔한 편입니다.</span></p><p><br></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">아담한 크기이고 e14 전구는 불포함입니다</span></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">이케아나 인터넷에서 사시면 되요.</span></p><p><br></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">전선길이도 길고 중간에 버튼있어서 켜고 끄기 편합니다.</span></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">가로 22 높이 25</span></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">콘센트도 전파사에서 새걸로 교체 했어요</span></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">반택 가능하고 합정역 부근 직거래 가능합니다.</span></p>', 'Y', '<p>size : 30 * 20 cm</p>', 'N', '2023-08-24 17:41:25', '2023-08-24 17:41:25', 'Y', 60000),
	(38, 10000063, '백쇼파', '01007070707', '패브릭 쇼파', 500000, 380000, '중국', 2, 'B', '<p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">3인용 패브릭 쇼파입니다!</span></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">사용은 약 2년정도 되었구요</span></p>', 'Y', '<p>size : 240 * 130 cm</p>', 'N', '2023-08-24 17:52:54', '2023-08-24 17:52:54', 'Y', 500000),
	(75, 10000099, '이망치', '01055874142', '오크 1500 3단 와이드 서랍장', 190000, 132000, '중국', 1, 'B', '<p><span style="color: rgb(33, 33, 33); background-color: rgb(255, 255, 255);">많은양의 의류 정리를 할 수 있는 1500 3단 와이드 서랍장 입니다.</span></p><p><span style="color: rgb(33, 33, 33); background-color: rgb(255, 255, 255);">6개의 서랍칸, 서랍레일은 고급 3단 볼레일 장착</span></p><p><span style="color: rgb(33, 33, 33); background-color: rgb(255, 255, 255);">색상은 오크라 침실 공간에 인테리어 하기에도 예뻐요^^</span></p><p><span style="color: rgb(33, 33, 33); background-color: rgb(255, 255, 255);">침실 서랍장 과 거실장으로 같이 쓰이는 실용적인 서랍장 입니다.</span></p><p><br></p><p><span style="color: rgb(33, 33, 33); background-color: rgb(255, 255, 255);">***사이즈</span></p><p><span style="color: rgb(33, 33, 33); background-color: rgb(255, 255, 255);">가로 1500mm, 세로 785mm, 폭 400mm</span></p>', 'Y', '<p>size : 150*50cm</p>', 'N', '2023-08-28 17:56:11', '2023-08-29 11:49:26', 'Y', 180000),
	(77, 10000074, '빵대', '01012344321', '디자인벤처스 폴카 2S 오크 멀티 책상', 1000000, 450000, '미상', 6, 'B', '<p>매입할게용</p>', 'Y', NULL, 'N', '2023-08-29 10:46:46', '2023-08-29 10:46:46', 'N', 0),
	(80, 10000074, '방대방', '01012344321', '이나피스퀘어 X 앱톤 인센스 홀더', 30000, 25000, '중국', 0, 'A', '<p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">박스만 개봉하고 안에 제품은 뜯어보지 않은 새상품입니다.(뒤에 사진 참고)</span></p><p><br></p><p><br></p>', 'Y', NULL, 'N', '2023-08-29 11:29:22', '2023-08-29 11:29:22', 'N', 0),
	(81, 10000072, '최재승', '01009879876', '미니어쳐 뜨개 몬스테라', 20000, 12000, '한국', 0, 'A', '<p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">뜨개 미니어쳐 몬스테라 입니다 :)</span></p>', 'W', NULL, 'N', '2023-08-29 11:31:30', '2023-08-29 11:31:30', 'N', 0),
	(82, 10000073, '최해지', '01078451245', '올드파인벽선반(올드파인 접시렉)빈티지가구', 1000000, 800000, '프랑스', 1, 'A', '<p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">너무너무 귀한 올드파인 벽선반 입니다!</span></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">접시렉으로도 사용할수있고</span></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">소품등 활용도가 매우 좋아요~</span></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">색상부터 쉐입까지 아름다운 실용적인</span></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">벽선반으로 밑에 서랍까지 3개있어서</span></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">더 인기 많아요🤍</span></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">사이즈가 생각보다 크니 상세사이즈 꼭 확인해주세요</span></p><p><br></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(33, 33, 33);">가로80x폭16x높이113</span></p>', 'W', NULL, 'N', '2023-08-29 11:34:17', '2023-08-29 11:34:17', 'N', 0),
