	(78, 10000074, 204, '블랙', '이 암막커튼 빛 차단 100퍼되서  밤인지 낮인지 구분이 안될정도에요 !일어나서\n시계를보니 5시길래 새벽인줄알고 다시 잤더니 오후 5시였어요!', 5, 1, '2023-08-28 10:41:28', '2023-08-28 10:41:28'),
	(79, 10000074, 200, '화이트', '제가 원하는 색이에요 너무 좋아요!', 5, 0, '2023-08-28 10:46:53', '2023-08-28 10:46:53'),
	(80, 10000074, 203, '', '차르르한게 거실 분위기를 바꿔놨어요!! 존예', 5, 0, '2023-08-28 10:51:08', '2023-08-28 10:51:08'),
	(81, 10000074, 186, '', '너무 좋아요 알러지 케어가 있어서 안심이에요', 5, 0, '2023-08-28 10:55:49', '2023-08-28 10:55:49'),
	(82, 10000074, 202, '', '커튼만 몇개를 사는건지 모르겠지만 너무 이쁘네요 좋아요!', 5, 0, '2023-08-28 10:56:17', '2023-08-28 10:56:17'),
	(83, 10000074, 201, '', '세탁 가능한 암막 커튼이라니 너무 좋아요 ', 5, 1, '2023-08-28 10:57:05', '2023-08-28 10:57:05'),
	(84, 10000074, 185, '', '엄청 고민하고 샀는데.. 상상 이상으로 만족합니다. 빈티지하면서 고급스럽고 포인트에 딱입니다.', 5, 0, '2023-08-28 10:58:05', '2023-08-28 10:58:05'),
	(85, 10000074, 183, '', '모양이 다른게 보이시나요 ? 아무리 수입이라도 기본검수는 할거라 생각했는데 .. 볼과 곰을 연결하는 막대가 곰과 전혀 연결되지를 못해 부득이 다른 나사를 잘라서 쓰고 막대는 안녕했습니다. 연휴가 끼어 교환과정이 엄청 귀찮을 것이 백퍼센트라 어찌어찌 달았는데 이거 하나 달려고 별짓 다했네요 ... 현재 모양에 불만은 없으나 최소한의 상태확인 !! 후 배송부탁드립니다.', 4, 1, '2023-08-28 10:59:00', '2023-08-28 10:59:00'),
	(86, 10000074, 182, '', '집이 너무 습해서 하나 장만했습니다 성능은 엄청 좋아요!', 5, 0, '2023-08-28 10:59:41', '2023-08-28 10:59:41'),
	(87, 10000074, 181, '', '리뷰 쓰는게 이렇게 힘들줄이야', 4, 0, '2023-08-28 11:00:23', '2023-08-28 11:00:23'),
	(88, 10000074, 180, '', '너무 귀여워여', 5, 0, '2023-08-28 11:00:52', '2023-08-28 11:00:52'),
	(90, 10000074, 178, '', '밤에 스탠드만 켜놓고 생활합니다! 무드있고 좋아요!', 5, 0, '2023-08-28 11:03:31', '2023-08-28 11:03:31'),
	(91, 10000074, 177, '', '좋기는 합니다 하지만 절때 이 가격주고 살만한 제품이 아닙니다.', 2, 1, '2023-08-28 11:04:39', '2023-08-28 11:04:39'),
