	(95, 10000074, 164, '', '플라스틱인데 생각보다 튼튼하고 조립도 엄청 쉽습니다! 물론 배송도 진짜 빨랐어요\n근데 비싸네요', 5, 0, '2023-08-28 11:10:20', '2023-08-28 11:10:20'),
	(96, 10000074, 163, '', '생각보다 너무 예쁘고 식탁이랑 색을 맞출려고 샀는데 만족합니다ㅎ', 5, 0, '2023-08-28 11:12:03', '2023-08-29 16:11:36'),
	(97, 10000074, 162, '', '냄새나요', 2, 0, '2023-08-28 11:19:08', '2023-08-28 11:19:08'),
	(98, 10000002, 207, '', '업체 배송이 생각보다 더욱 빨라서 이쁘게 잘 쓰거 있습니다', 5, 0, '2023-08-28 14:33:40', '2023-08-28 14:33:40'),
	(99, 10000002, 205, '', '배송도빠르고 입주한 아파트에 찰떡이예요\n사진은 그냥 집자랑하고싶어서 찍었어요 ㅎㅎ', 5, 1, '2023-08-28 14:37:33', '2023-08-28 14:37:33'),
	(100, 10000002, 203, '연피치', '개별론데요?', 2, 0, '2023-08-28 15:01:37', '2023-08-28 15:01:37'),
	(101, 10000002, 147, '오크 Q(퀸)', '배송기사님이 직접 조립해주셨어요 친절하세요! 수납 공간이 생겨서 좋아요.', 5, 0, '2023-08-28 15:04:44', '2023-08-28 15:04:44'),
	(102, 10000002, 202, '네프린넨 속지커튼(9900)', '설치하느라 진짜 힘들긴 했는데 진짜 예뽀..감탄..', 4, 0, '2023-08-28 15:23:40', '2023-08-28 15:23:40'),
	(103, 10000002, 200, '차콜', '딱 원하던 재질과 두께... 너무 포근해요 꿀잠 자고있습니다 ㅎㅎ', 4, 0, '2023-08-28 15:25:27', '2023-08-28 15:25:27'),
	(104, 10000064, 186, '뮤즈_그레이', '일체형이라 편하고 호텔침구 부럽지 않네요', 4, 0, '2023-08-28 15:28:18', '2023-08-28 15:28:18'),
	(105, 10000064, 185, '단품', '판매자분들은 정말 친절하시지만 한개 이상 주문 하신다면 상당히 오랜기간을 기다려야합니다. 그리고 동봉되는 전등은 판매사의 마음이기 때문에 있을 수도 있고 없을 수도 있다는 당혹스러운 점도 곤란하네요. 예쁘기는 하지만 유리인 만큼 무겁고 또 매갈리는 줄의 지지부분이 나사 하나이기 때문에 안정성에서 좀 신경이 쓰입니다. 장점. 예쁜 디자인 예쁘긴함. 단점. 1. 직구인 만큼 느리다. 두개 이상일 경우 따로따로 오기때문에 더 느리다. 2. 전등 동봉은 보내주시는 회사 마음 안 올 수도 있다. ( 이 전등에 맞는 전구 찾는게 꽤나 까다롭고 충분한 광량이 있는 전구는 더 찾는게 피로함) 3. 무겁고 전구 지지부분이 불안함 얇은 벽일시 참고.', 3, 0, '2023-08-28 15:30:04', '2023-08-28 15:30:04'),
	(106, 10000064, 184, 'XL', '타업체보다 조금 투명한느낌이고 저렴히 잘 구매했습니다!', 5, 0, '2023-08-28 15:31:30', '2023-08-28 15:31:30'),
	(107, 10000064, 203, '화이트', '잘 안나왔지만 거실 분위기 얘가 다 책임짐 미쳤음 커튼 조명까지 달면 그냥 끝.', 5, 0, '2023-08-28 15:34:05', '2023-08-28 15:34:05'),
	(108, 10000064, 207, '단일상품', '아무리 많이 사도 계속 100만원이 충전됌 님들도 빨리 사셈', 4, 0, '2023-08-28 15:39:44', '2023-08-28 15:39:44'),
	(109, 10000065, 204, '블루', '블루로 샀는데 왜 아이보리가 온지는 모르겠지만 이쁘네요', 4, 1, '2023-08-28 15:51:44', '2023-08-28 15:51:44'),
	(110, 10000065, 159, '딥그린', '기사님도 정말 친절하시고 색상이 사진 그대로입니다! 예뻐요! 그리고 적당히 단단해요~~!!! 가성비 쇼파 강추~~', 5, 0, '2023-08-28 15:53:52', '2023-08-28 15:53:52'),
	(111, 10000065, 184, 'S', '수납합 깔끔하고 사이즈도 커서 정리하기 좋습니다', 4, 0, '2023-08-28 16:00:38', '2023-08-28 16:00:38'),
	(112, 10000065, 185, '', '간판 사장님께서 요 조명이 가장 이쁘다셨어요!', 5, 0, '2023-08-28 16:05:38', '2023-08-28 16:05:38'),
	(113, 10000065, 126, '에이프릴프레쉬', '저렴해서 기대 안했는데 너무 좋아요 향기가', 5, 0, '2023-08-28 16:10:23', '2023-08-28 16:10:23'),
	(114, 10000004, 207, '단일상품', '너무 좋습니다! 잘 사용하겠습니다 ㅎ', 5, 0, '2023-08-29 09:31:56', '2023-08-29 09:36:10'),
	(115, 10000064, 204, '블랙', '블라인드를 할지 커튼을 할지 진짜 백번도 넘게 고민했는데 역시 인테리어적 측면에서는 커튼이 훨씬 예쁘기 때문에 커튼으로 선택했는데 너무 너무 만족해요 주름도 예쁘게 잘 잡혀 있고 설치도 생각보다 쉽고~ 너무 예뻐서 볼 때마다 행복하네요~ㅎㅎ 암막도 효과가 좋은 편이라 아주 잘 산 것 같아요~!', 5, 0, '2023-08-29 11:43:05', '2023-08-29 11:43:05'),
	(116, 10000055, 204, '화이트', '기대하긴했는데 기대보다 잘맞고 이쁘네요 깔끔하고 이쁜 암막커튼을 원했는데 마음에들어요 거기다가 향균커튼이라 자주 세탁못하는 커튼에 딱이에요 ㅎㅎ 너무마음에들어서 동네방네 자랑하고 다니고있어요~', 5, 0, '2023-08-29 11:44:37', '2023-08-29 11:44:37'),
	(117, 10000071, 204, '화이트', '암막됴 너무 잘되고 맞춤으로 한 커튼처럼 너무 딱이에용!ㅎㅎ 맞춤 너무 비싸서 기성품으로 했는데 맞춤 안하길 잘했네용 100%만족합니당', 4, 0, '2023-08-29 11:46:29', '2023-08-29 11:46:29'),
	(118, 10000072, 204, '블루 + 블랙', '여자 혼자 셀프로 될까 했는데 은근 설치가 쉬웠어요 설치 하고나니 너무 깔끔하니 예뻐서 대만족입니다 제품 상태 온전하게 잘 왔고 질도 가격대비 넘 괜찮아요 아이보리라 살짝 따뜻한 색감이 지금이랑 어울리고 무난해서 사계절 유용하게 쓸 것 같네요 사기 전엔 많이 고민했는데.. 달고나니 조금이라도 일찍 살걸 그랬다 싶은 생각이 드네요 ㅋㅋ', 5, 1, '2023-08-29 11:48:24', '2023-08-29 11:48:49'),
